import React from 'react'
import {Button} from 'react-bootstrap'

class StartScreen extends React.Component{
  clickHandler=()=>{
    let{gameStart}=this.props
    gameStart()
  }
  render(){
    return(
      <Button onClick={this.clickHandler}>
      Start Game
      </Button>
    )
  }
}


export default StartScreen
